package nl.ncaj.reader.ico

import kotlinx.io.bytestring.ByteString
import kotlin.test.Test
import kotlin.test.assertEquals

class IcoReaderTest {

    @OptIn(ExperimentalStdlibApi::class)
    @Test
    fun loadIcoFile() {
        val file = readResource("./computer_2.ico")
        val images = IcoReader.read(file)
        for (i in images.indices) {
            assertEquals(icoComputer2[i], images[i].data.joinToString("") { it.toHexString() })
        }
    }
}

expect fun readResource(resourceName: String): ByteString

private val icoComputer2 = listOf(
    "",
    "",
    "",
    "",
    "",
    ""
)